export default class APIService {

  static submitEmail(email) {
    return fetch(`http://localhost:5000`, {
      'method':'POST',
      headers: {
	'Content-Type':'application/json'
      },
      email: JSON.stringify(email)
    })
    .then(resp => console.log(email))
    .catch(error => console.log(error))
  }
}
